import styled from 'styled-components';

export const StyledHeader = styled.div`
  background: #1c1c1c;

  box-sizing: border-box;

  .header-content {
    max-width: 1280px;
    heaight:100px;
    margin: 0 auto;
    box-sizing: border-box;

    @media screen and (max-width: 200px) {
      max-width: 1280px;
      min-height: 0px;
    }
  }
`;

export const StyledRMDBLogo = styled.img`
  width: 150px;


  @media screen and (max-width: 500px) {
    width: 150px;
    margin-top: 5px;
  }
`;
